import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Paper from '@mui/material/Paper';

export default function Student() {
  return (
    <Box
      sx={{
        display: 'flex',
        justifyContent: 'center', // 将其水平居中
        alignItems: 'center', // 将其垂直居中
        height: '100vh', // 让外部容器撑满整个视口高度
        marginTop: '10vh', // 将Paper向上移动一些
      }}
    >
      <Paper elevation={3} sx={{ width: 300, padding: 2 }}> {/* 调整Paper的大小和内边距 */}
        <TextField id="outlined-basic" label="Student Name" variant="outlined" />
        <Box sx={{ height: 16 }} /> {/* 添加16px的垂直间距 */}
        <TextField id="outlined-basic" label="Student Address" variant="outlined" />
      </Paper>
    </Box>
  );
}
